import React from 'react';
import Calendar from 'rc-calendar';
import 'rc-calendar/assets/index.css';

const MyCalendar = () => {
  return (
    <Calendar
      onSelect={date => console.log(date)}
      disabledDate={date => true}
    />
  );
};

export default MyCalendar;
